INSERT INTO `entertainment_content` VALUES (69049,'The Other Side of the Wind',2018,'Surrounded by fans and skeptics, grizzled director J.J. \"Jake\" Hannaford returns from years abroad in Europe to a changed Hollywood, where he attempts to make his innovative comeback film.  This film was started in 1970 but never completed during Welles lifetime.','18',NULL,'https://image.tmdb.org/t/p/original/kFky1paYEfHxfCYByEc9g7gn6Zk.jpg'),(196291,'She\'s Gotta Have It',2017,'Nola Darling struggles to define herself and divide her time among her friends, job and three lovers. A new take on Spike Lee\'s film, in 10 episodes.','16',NULL,'https://image.tmdb.org/t/p/original/fcbZ94T3eySDCMAlVfe3s69LiDJ.jpg'),(219432,'Bloodline',2015,'A dramatic thriller that explores the demons lurking beneath the surface of a contemporary American family. The Rayburns are hard-working pillars of their Florida Keys community. But when the black sheep son comes home for the 45th anniversary of his parents\' hotel, he threatens to expose the Rayburns\' dark secrets and shameful past, pushing his siblings to the limits of family loyalty.','16',NULL,'https://image.tmdb.org/t/p/original/uEaqgEjAShqrziUia4XBzvXXGXP.jpg'),(235918,'The Fairly OddParents',2001,'The zany, fast-paced adventures of a 10-year-old boy and his fairy godparents, who inadvertently create havoc as they grant wishes for their pint-sized charge.','PG 9',NULL,'https://image.tmdb.org/t/p/original/3ryMj7tIvVtiXyI2tLvHYTjOjq4.jpg'),(238784,'Gilmore Girls',2000,'Set in the charming town of Stars Hollow, Connecticut, the series follows the captivating lives of Lorelai and Rory Gilmore, a mother/daughter pair who have a relationship most people only dream of.','PG 13',NULL,'https://image.tmdb.org/t/p/original/mjDOpFxusZb05umOQJbYRq8J4Vi.jpg'),(262158,'Dogs',2018,'These six intimate stories explore the abiding emotional bonds that form between dogs and their caregivers, no matter the circumstances.','PG 9',NULL,'https://image.tmdb.org/t/p/original/dz4fP4l01VTwqa3FZFslDf2GfDD.jpg'),(290988,'Trailer Park Boys',2001,'Follow the booze-fueled misadventures of three longtime pals and petty serial criminals who run scams from their Nova Scotia trailer park.','16',NULL,'https://image.tmdb.org/t/p/original/nIcIwVTYcZnW1BDzexGfFO7KmX1.jpg'),(315642,'Wazir',2016,'\'Wazir\' is a tale of two unlikely friends, a wheelchair-bound chess grandmaster and a brave ATS officer. Brought together by grief and a strange twist of fate, the two men decide to help each other win the biggest games of their lives. But there\'s a mysterious, dangerous opponent lurking in the shadows, who is all set to checkmate them.','PG 13',NULL,'https://image.tmdb.org/t/p/original/A5I6rAFG3rLborOF8BCcjs4EBcx.jpg'),(332902,'Borderliner',2017,'To protect his family, police detective Nikolai covers up a murder case. But when his co-investigator Anniken suspects foul play, he is trapped in a dangerous game on duty, blurring the line between right and wrong.','16',NULL,'https://image.tmdb.org/t/p/original/sGRMKHKi6l8Jzkjy6PqHDMt7G4q.jpg'),(337926,'Chat, The King of Brazil',2015,'The true story of Assis Chateaubriand, the first magnate of communications in Brazil. Due to his influence during the late 1930s up to the early 1960s, he has come to be called \'the Brazilian Citizen Kane\'.','PG',NULL,'https://image.tmdb.org/t/p/original/fddTyLTLN7pHZAb9dIqGqQx2jAv.jpg'),(341957,'The Paper',2016,'The last independent newsroom in the country is taken over by a construction magnate for the reasons that have nothing to do with love or respect for journalism.','16',NULL,'https://image.tmdb.org/t/p/original/eyru2nxuFwJQ2ZJDJfRFIqbX4Uw.jpg'),(346631,'Blood and Bone',2009,'In Los Angeles, an ex-con takes the underground fighting world by storm in his quest to fulfill a promise to a dead friend.','18',NULL,'https://image.tmdb.org/t/p/original/4XoqjwKhqN3GlGt0fQtcY2OhkZq.jpg'),(353049,'Chappelle\'s Show',2003,'Dave Chappelle\'s singular point of view is unleashed through a combination of laidback stand-up and street-smart sketches.','PG 13',NULL,'https://image.tmdb.org/t/p/original/aHpTmNU2wLHokoVpzcnh2VQBJOI.jpg'),(362120,'Scary Movie 4',2006,'Cindy finds out the house she lives in is haunted by a little boy and goes on a quest to find out who killed him and why. Also, Alien \"Tr-iPods\" are invading the world and she has to uncover the secret in order to stop them.','PG 13',NULL,'https://image.tmdb.org/t/p/original/vL03Mk1ES5uo1ZdXovz6NtgsbSb.jpg'),(364845,'NCIS',2003,'From murder and espionage to terrorism and stolen submarines, a team of special agents investigates any crime that has a shred of evidence connected to Navy and Marine Corps personnel, regardless of rank or position.','PG 13',NULL,'https://image.tmdb.org/t/p/original/2exOHePjOTquUsbThPGhuEjYTyA.jpg'),(365545,'Nappily Ever After',2018,'After an accident at the hair salon, Violet realizes she\'s not living life to the fullest. A soulful barber helps her put the pieces back together.','18',NULL,'https://image.tmdb.org/t/p/original/lxXsGqxUwSxypffv8hn3r332jf4.jpg'),(365907,'A Walk Among the Tombstones',2014,'Private investigator Matthew Scudder is hired by a drug kingpin to find out who kidnapped and murdered his wife.','18',NULL,'https://image.tmdb.org/t/p/original/bQTHTZezSudf27mMQtedHf1XpgO.jpg'),(366548,'Happy Feet',2006,'Into the world of the Emperor Penguins, who find their soul mates through song, a penguin is born who cannot sing. But he can tap dance something fierce!','PG',NULL,'https://image.tmdb.org/t/p/original/zP4CK9O70P8GDilfTkPm4lrmaks.jpg'),(373883,'Halloween',2007,'After being committed for 17 years, Michael Myers, now a grown man and still very dangerous, escapes from the mental institution (where he was committed as a 10 year old) and he immediately returns to Haddonfield, where he wants to find his baby sister, Laurie. Anyone who crosses his path is in mortal danger','18',NULL,'https://image.tmdb.org/t/p/original/cD8JrfSEI4j7WVnKM1GdiYzMoUh.jpg'),(381061,'Casino Royale',2006,'Le Chiffre, a banker to the world\'s terrorists, is scheduled to participate in a high-stakes poker game in Montenegro, where he intends to use his winnings to establish his financial grip on the terrorist market. M sends Bondon his maiden mission as a 00 Agentto attend this game and prevent Le Chiffre from winning. With the help of Vesper Lynd and Felix Leiter, Bond enters the most important poker game in his already dangerous career.','PG',NULL,'https://image.tmdb.org/t/p/original/lMrxYKKhd4lqRzwUHAy5gcx9PSO.jpg'),(385880,'Monster House',2006,'Monsters under the bed are scary enough, but what happens when an entire house is out to get you? Three teens aim to find out when they go up against a decrepit neighboring home and unlock its frightening secrets.','PG',NULL,'https://image.tmdb.org/t/p/original/zCRPr4bkO3ae0U1134vJ39xZnAG.jpg'),(388629,'One Piece',1999,'Years ago, the fearsome Pirate King, Gol D. Roger was executed leaving a huge pile of treasure and the famous \"One Piece\" behind. Whoever claims the \"One Piece\" will be named the new King of the Pirates. Monkey D. Luffy, a boy who consumed a \"Devil Fruit,\" decides to follow in the footsteps of his idol, the pirate Shanks, and find the One Piece. It helps, of course, that his body has the properties of rubber and that he\'s surrounded by a bevy of skilled fighters and thieves to help him along the way. Luffy will do anything to get the One Piece and become King of the Pirates!','PG 13',NULL,'https://image.tmdb.org/t/p/original/cMD9Ygz11zjJzAovURpO75Qg7rT.jpg'),(395495,'Catch and Release',2006,'Gray Wheeler just lost everything. But it could be the best thing that ever happened to her. After the death of her fianc?, Gray moves in with her late love\'s best friends. While Sam and Dennis do their best to cheer Gray up, Fritz doesn\'t seem to care. Once Gray breaks through Fritz\'s defenses, however, she finally sees why her fianc? thought so highly of him. As they spend more time together, Gray learns that her chances for love have not died out with her fianc?. But when some surprise guests show up on their doorstep, it\'ll take the love of all of her new friends to help Gray learn that life may be messy, but love is messier.','PG 13',NULL,'https://image.tmdb.org/t/p/original/4NanpeAso4c2KFdjHiJ3stByHHS.jpg'),(410297,'The Lake House',2006,'A lonely doctor who once occupied an unusual lakeside home begins exchanging love letters with its former resident, a frustrated architect. They must try to unravel the mystery behind their extraordinary romance before it\'s too late.','PG',NULL,'https://image.tmdb.org/t/p/original/tHpc1118dYWLnHZleGhwZxRbpae.jpg'),(413573,'Grey\'s Anatomy',2005,'Follows the personal and professional lives of a group of doctors at Seattles Grey Sloan Memorial Hospital.','PG 13',NULL,'https://image.tmdb.org/t/p/original/jcEl8SISNfGdlQFwLzeEtsjDvpw.jpg'),(414982,'Final Destination 3',2006,'A student\'s premonition of a deadly rollercoaster ride saves her life and a lucky few, but not from death itself  which seeks out those who escaped their fate.','18',NULL,'https://image.tmdb.org/t/p/original/p7ARuNKUGPGvkBiDtIDvAzYzonX.jpg'),(416236,'The Spiderwick Chronicles',2008,'Upon moving into the run-down Spiderwick Estate with their mother, twin brothers Jared and Simon Grace, along with their sister Mallory, find themselves pulled into an alternate world full of faeries and other creatures.','PG',NULL,'https://image.tmdb.org/t/p/original/y0zqUbwK8FWIkelnlmnRkntz9F8.jpg'),(417299,'Avatar: The Last Airbender',2005,'In a war-torn world of elemental magic, a young boy reawakens to undertake a dangerous mystic quest to fulfill his destiny as the Avatar, and bring peace to the world.','PG 9',NULL,'https://image.tmdb.org/t/p/original/9jUuxbMSp3cwC2DDrSAs2F43Ric.jpg'),(417325,'Food Wars! Shokugeki no Soma',2015,'Yukihira Souma\'s dream is to become a full-time chef in his father\'s restaurant and surpass his father\'s culinary skill. But just as Yukihira graduates from middle schools his father, Yukihira Jouichirou, closes down the restaurant to travel and cook around the world. Although downtrodden, Souma\'s fighting spirit is rekindled by a challenge from Jouichirou which is to survive in an elite culinary school where only 10% of the students graduate. Can Souma survive?','16',NULL,'https://image.tmdb.org/t/p/original/drteIrKPh0qaTYitGkxAOKoidsR.jpg'),(419058,'Phir Hera Pheri',2006,'Babu Rao, Raju and Shyam, are living happily after having risen from rags to riches. Still, money brings the joy of riches and with it the greed to make more money - and so, with a don as an unknowing investor, Raju initiates a new game.','PG',NULL,'https://image.tmdb.org/t/p/original/c1Mvyd983ZyrU5Vf2aKEe6WncSq.jpg'),(420294,'The Texas Chainsaw Massacre: The Beginning',2006,'Chrissie and her friends set out on a road trip for a final fling before one is shipped off to Vietnam. Along the way, bikers harass the foursome and cause an accident that throws Chrissie from the vehicle. The lawman who arrives on the scene kills one of the bikers and brings Chrissie\'s friends to the Hewitt homestead, where young Leatherface is learning the tools of terror.','18',NULL,'https://image.tmdb.org/t/p/original/2S0XKVZGZUnsF4DjLOyZ0C63bWO.jpg'),(425601,'Trailer Park Boys: The Movie',2006,'Set in a separate storyline not related to the \"Trailer Park Boys\" Television show, but with the same lovable characters. The boys get arrested for robbing an ATM machine and spend 18 months in jail. When the get out, they decide to pull off \"The Big Dirty\" which is to steal a large amount of coins because they are untraceable and quit their life of crime forever','18',NULL,'https://image.tmdb.org/t/p/original/lBmoxMfxxIepgpoByFr78ygnjrZ.jpg'),(427327,'Hairspray',2007,'Pleasantly plump teenager Tracy Turnblad auditions to be on Baltimore\'s most popular dance show - The Corny Collins Show - and lands a prime spot. Through her newfound fame, she becomes determined to help her friends and end the racial segregation that has been a staple of the show.','PG',NULL,'https://image.tmdb.org/t/p/original/fgMka3HtFvI5OgW1eYdR9XpySxH.jpg'),(435651,'The Giver',2014,'In a seemingly perfect community, without war, pain, suffering, differences or choice, a young boy is chosen to learn from an elderly man about the true pain and pleasure of the \"real\" world.','PG 13',NULL,'https://image.tmdb.org/t/p/original/dul62Av4pgi5x8LP7ELHzNyka9Z.jpg'),(436331,'Friends with Money',2006,'After she quits her lucrative job, Olivia finds herself unsure about her future and her relationships with her successful and wealthy friends.','18',NULL,'https://image.tmdb.org/t/p/original/hJmfZ1b6ZzT4bORo4f2FyWbkgAx.jpg'),(438488,'Terminator Salvation',2009,'All grown up in post-apocalyptic 2018, John Connor must lead the resistance of humans against the increasingly dominating militaristic robots. But when Marcus Wright appears, his existence confuses the mission as Connor tries to determine whether Wright has come from the future or the past -- and whether he\'s friend or foe.','PG 13',NULL,'https://image.tmdb.org/t/p/original/1guPC6KYYRjUZpPQstGc0Frlfrd.jpg'),(440963,'The Bourne Ultimatum',2007,'Bourne is brought out of hiding once again by reporter Simon Ross who is trying to unveil Operation Blackbriar, an upgrade to Project Treadstone, in a series of newspaper columns. Information from the reporter stirs a new set of memories, and Bourne must finally uncover his dark past while dodging The Company\'s best efforts to eradicate him.','PG 13',NULL,'https://image.tmdb.org/t/p/original/15rMz5MRXFp7CP4VxhjYw4y0FUn.jpg'),(442236,'Fuga',2006,'Could a brilliant composer\'s music actually be killing his loved ones? Eliseo can\'t help but believe it when his younger sister dies tragically and then his pianist Georgina suddenly dies on the piano. Completely traumatized, Eliseo is taken to a mental hospital where he can find escape only through music.','PG',NULL,'https://image.tmdb.org/t/p/original/8oZ0me8AFv3181yiIsVjXkH11Db.jpg'),(448694,'Puss in Boots',2011,'Long before he even met Shrek, the notorious fighter, lover and outlaw Puss in Boots becomes a hero when he sets off on an adventure with the tough and street smart Kitty Softpaws and the mastermind Humpty Dumpty to save his town. This is the true story of The Cat, The Myth, The Legend... The Boots.','PG',NULL,'https://image.tmdb.org/t/p/original/7a5Jzjr9TmffGy76y1SZhn3sCiz.jpg'),(449994,'Jodhaa Akbar',2008,'Jodhaa Akbar is a sixteenth century love story about a marriage of alliance that gave birth to true love between a great Mughal Emperor, Akbar and a Rajput princess, Jodhaa.','PG 13',NULL,'https://image.tmdb.org/t/p/original/bEltVQbNJpsl9sopLVkE5z24Ssj.jpg'),(449999,'Kabhi Alvida Naa Kehna',2006,'Dev and Maya are both married to different people. Settled into a life of domestic ritual, and convinced that they are happy in their respective relationships, they still yearn for something deeper and more meaningful, which is precisely what they find in each other.','PG',NULL,'https://image.tmdb.org/t/p/original/dkYQgRPuik4FGIUdGGVYGQJWrHa.jpg'),(450259,'Blood Diamond',2006,'An ex-mercenary turned smuggler. A Mende fisherman. Amid the explosive civil war overtaking 1999 Sierra Leone, these men join for two desperate missions: recovering a rare pink diamond of immense value and rescuing the fisherman\'s son, conscripted as a child soldier into the brutal rebel forces ripping a swath of torture and bloodshed countrywide.','18',NULL,'https://image.tmdb.org/t/p/original/tnLxPpajkbVdbQl5B9CuD7sSpz9.jpg'),(452046,'Criminal Minds',2005,'An elite team of FBI profilers analyze the country\'s most twisted criminal minds, anticipating their next moves before they strike again. The Behavioral Analysis Unit\'s most experienced agent is David Rossi, a founding member of the BAU who returns to help the team solve new cases.','PG 13',NULL,'https://image.tmdb.org/t/p/original/7TCwgX7oQKxcWYEhSPRmaHe6ULN.jpg'),(452625,'Good Luck Chuck',2007,'Cursed since childhood, dentist Charlie Logan cannot find the right woman. Even worse, he learns that each of his ex-girlfriends finds true love with the man she meets after her relationship with him ends. Hearing of Charlie\'s reputation as a good-luck charm, women from all over line up for a quick tryst. But when Charlie meets the woman of his dreams, he must find a way to break the curse or risk losing her to the next man she meets.','PG',NULL,'https://image.tmdb.org/t/p/original/b2VgUoXR9iAtAf8nA0mvdTr7cOt.jpg'),(453556,'TMNT',2007,'After the defeat of their old arch nemesis, The Shredder, the Turtles have grown apart as a family. Struggling to keep them together, their rat sensei, Splinter, becomes worried when strange things begin to brew in New York City.','PG',NULL,'https://image.tmdb.org/t/p/original/6ZCWn7BGpDLBDigtdiuGyBdEqab.jpg'),(453562,'42',2013,'The powerful story of Jackie Robinson, the legendary baseball player who broke Major League Baseballs color barrier when he joined the roster of the Brooklyn Dodgers. The film follows the innovative Dodgers general manager Branch Rickey, the MLB executive who first signed Robinson to the minors and then helped to bring him up to the show.','PG 13',NULL,'https://image.tmdb.org/t/p/original/iZ7jVGQWj3eBUdqwAPUlKk0BaS2.jpg'),(456020,'Waist Deep',2006,'An ex-convict (Tyrese) gets tangled up with a gang after his car is hijacked with his son inside.','18',NULL,'https://image.tmdb.org/t/p/original/xBshLPA17Sbq1AJEACpkDLnRvPd.jpg'),(459724,'Vientos de agua',2006,'Vientos de agua is a 2006 cult Argentine- Spanish mini TV series created by Juan Jos? Campanella. The drama traces a Spaniard\'s emigration to Argentina in the 1930s, and, years later, his son\'s return to modern-day Spain.\n\nIt aired in Spain in January 2006, on Telecinco for only one series of 13 episodes.\n\nWhile a hit in Argentina, because of lower ratings in Spain it was taken out of the prime-time slot to 1.00 in morning, and was eventually cancelled due to downloading of series from the internet.\n\nDespite a campaign of support to continue into a second series it only produced 13 episodes. Despite this the series was a hit in DVD sellings.','16',NULL,'https://image.tmdb.org/t/p/original/fco3uj8dOGxGae7RHsKi0mdxYqU.jpg'),(460681,'Supernatural',2005,'When they were boys, Sam and Dean Winchester lost their mother to a mysterious and demonic supernatural force. Subsequently, their father raised them to be soldiers. He taught them about the paranormal evil that lives in the dark corners and on the back roads of America ... and he taught them how to kill it. Now, the Winchester brothers crisscross the country in their \'67 Chevy Impala, battling every kind of supernatural threat they encounter along the way. ','PG 13',NULL,'https://image.tmdb.org/t/p/original/KoYWXbnYuS3b0GyQPkbuexlVK9.jpg'),(462499,'Rambo',2008,'When governments fail to act on behalf of captive missionaries, ex-Green Beret John James Rambo sets aside his peaceful existence along the Salween River in a war-torn region of Thailand to take action.  Although he\'s still haunted by violent memories of his time as a U.S. soldier during the Vietnam War, Rambo can hardly turn his back on the aid workers who so desperately need his help.','18',NULL,'https://image.tmdb.org/t/p/original/r8LPeldxskHrGJTPfhICguCip2H.jpg'),(465538,'Michael Clayton',2007,'A law firm brings in its \'fixer\' to remedy the situation after a lawyer has a breakdown while representing a chemical company that he knows is guilty in a multi-billion dollar class action suit.','18',NULL,'https://image.tmdb.org/t/p/original/hhkW4yVIGo8Bee3UITKvqOvhNMG.jpg'),(467200,'The Other Boleyn Girl',2008,'A sumptuous and sensual tale of intrigue, romance and betrayal set against the backdrop of a defining moment in European history: two beautiful sisters, Anne and Mary Boleyn, driven by their family\'s blind ambition, compete for the love of the handsome and passionate King Henry VIII.','PG 13',NULL,'https://image.tmdb.org/t/p/original/9zD3hXV24zJzYvSuakXZU8yMEY4.jpg'),(472181,'The Smurfs',2011,'When the evil wizard Gargamel chases the tiny blue Smurfs out of their village, they tumble from their magical world and into ours -- in fact, smack dab in the middle of Central Park. Just three apples high and stuck in the Big Apple, the Smurfs must find a way to get back to their village before Gargamel tracks them down.','PG',NULL,'https://image.tmdb.org/t/p/original/vRhnslP2gW0QDym7BsMeSuioUfK.jpg'),(475290,'Hail, Caesar!',2016,'When a Hollywood star mysteriously disappears in the middle of filming, the studio sends their fixer to get him back.','PG 13',NULL,'https://image.tmdb.org/t/p/original/txvoksUbyxqvaOvDfEbwW5nEcmX.jpg'),(477071,'Premonition',2007,'A depressed housewife who learns her husband was killed in a car accident the day previously, awakens the next morning to find him alive and well at home, and then awakens the day after to a world in which he is still dead.','PG 13',NULL,'https://image.tmdb.org/t/p/original/vKW1XIYrIqVrbCaYj9FQDHKXR8R.jpg'),(478087,'21',2008,'Ben Campbell is a young, highly intelligent, student at M.I.T. in Boston who strives to succeed. Wanting a scholarship to transfer to Harvard School of Medicine with the desire to become a doctor, Ben learns that he cannot afford the $300,000 for the four to five years of schooling as he comes from a poor, working-class background. But one evening, Ben is introduced by his unorthodox math professor Micky Rosa into a small but secretive club of five. Students Jill, Choi, Kianna, and Fisher, who are being trained by Professor Rosa of the skill of card counting at blackjack.','PG 13',NULL,'https://image.tmdb.org/t/p/original/efG8Po57alqSlhqHU1lXJ3duG6t.jpg'),(479751,'Sivaji: The Boss',2007,'Corrupt police and politicians target a computer engineer for trying to better the lives of less privileged citizens.','PG 13',NULL,'https://image.tmdb.org/t/p/original/t5oPb8q91gdClkyJG2hxyebEglv.jpg'),(480687,'Hall Pass',2011,'When best buds Rick and Fred begin to show signs of restlessness at home, their wives take a bold approach to revitalize their marriages, they grant the guys a \'hall pass\'one week of freedom to do whatever they want. At first, it seems like a dream come true, but they quickly discover that their expectations of the single lifeand themselvesare completely and hilariously out of sync with reality.','18',NULL,'https://image.tmdb.org/t/p/original/HqwUkeLOm6PUvcMntKvN0iSNR.jpg'),(486578,'First Sunday',2008,'Durell and LeeJohn are best friends and bumbling petty criminals. When told they have one week to pay a $17,000 debt or Durell will lose his son, they come up with a desperate scheme to rob their neighborhood church. Instead, they end up spending the night in the presence of the Lord and are forced to deal with much more than they bargained for.','PG 13',NULL,'https://image.tmdb.org/t/p/original/9l0sdc7ohLe6TdFsYyCTBnVn1F8.jpg'),(486655,'Stardust',2007,'In a countryside town bordering on a magical land, a young man makes a promise to his beloved that he\'ll retrieve a fallen star by venturing into the magical realm. His journey takes him into a world beyond his wildest dreams and reveals his true identity.','PG 13',NULL,'https://image.tmdb.org/t/p/original/7zbFmxy3DqKYL2M8Hop6uylp2Uy.jpg'),(487831,'The IT Crowd',2006,'Two I.T. nerds and their clueless female manager, who work in the basement of a very successful company. When they are called on for help, they are never treated with any respect at all.','PG 13',NULL,'https://image.tmdb.org/t/p/original/qZXkBoOUYzvKI4UCMzDQ5kqWHjh.jpg'),(488798,'Welcome',2007,'Dubai-based criminal don Uday takes it upon himself to try and get his sister Sanjana married - in vain, as no one wants to be associated with a crime family. Uday\'s associate Sagar Pandey finds a young man, Rajiv, who lives with his maternal uncle and aunt - Dr. and Mrs. Ghunghroo. Through extortion he compels Ghunghroo to accept this matrimonial alliance. But Rajiv has already fallen in love with young woman in South Africa. When the time comes to get Rajiv formally engaged to this woman, he finds out that Sanjana and she are the very same. With no escape from this predicament, the wedding is planned, with hilarious consequences.','PG',NULL,'https://image.tmdb.org/t/p/original/fudxnXlTTBIDCkpR7XhlIgkNaUY.jpg'),(491603,'H2O: Just Add Water',2006,'H2O: Just Add Water revolves around three teenage girls facing everyday teen problems with an added twist: they cope with the burden of growing a giant fin and transforming into mermaids whenever they come in contact with water.','PG 9',NULL,'https://image.tmdb.org/t/p/original/3VslPNpGMAF8Hklxs8RZI6cLa6F.jpg'),(492896,'My Suicide',2009,'After declaring that he\'s going to film himself committing suicide for a school project, Archie videotapes his surprising interactions with worried family members, interested classmates, unreliable medical experts and the hottest girl in school.','18',NULL,'https://image.tmdb.org/t/p/original/hO5i4K6F2j9r18li916kLFAXElf.jpg'),(496424,'30 Rock',2006,'Liz Lemon, the head writer for a late-night TV variety show in New York, tries to juggle all the egos around her while chasing her own dream.','PG 13',NULL,'https://image.tmdb.org/t/p/original/eYYQWACx7ttUzRwTNYuo6zveqpE.jpg'),(499375,'Guru',2007,'Gurukant Desai hails from Idhar, a small village in Gujarat, but dreams of setting up his own business in Mumbai. After he returns from Turkey, he marries Sujatha for getting the dowry and arrives in Mumbai to start his business. This film chronicles the obstacles he meets, his subsequent rise and the huge backlash he receives when it is revealed that he used unethical means to rise in the business circuit.','PG 13',NULL,'https://image.tmdb.org/t/p/original/xX2BJ5sn3ElTZqhnOEod8ZXsCQg.jpg'),(758745,'Friday Night Lights',2006,'The trials and triumphs of life in t