p/original/dO0F66lM1jehIH5bsooKSbdz7xG.jpg'),(795461,'Scary Movie 5',2013,'Home with their newly-formed family, happy parents Dan and Jody are haunted by sinister, paranormal activities. Determined to expel the insidious force, they install security cameras and discover their family is being stalked by an evil dead demon.','PG 13',NULL,'https://image.tmdb.org/t/p/original/vBqLLxE6GaAPhO6v9EFvFbLZ7Ap.jpg'),(800003,'Delta Farce',2007,'Three bumbling Army reservists are hustled onto a plane headed for combat in Iraq -- but the fact that the plane drops them in Mexico doesn\'t stop them from \"liberating\" what they believe to be the Middle East.','PG 13',NULL,'https://image.tmdb.org/t/p/original/8OkLfZGETr199O1hBV2iC95UBuB.jpg'),(800039,'Forgetting Sarah Marshall',2008,'When Sarah Marshall dumps aspiring musician Peter Bretter for rock star Aldous Snow, Peter\'s world comes crashing down. His best friend suggests that Peter should get away from everything and to fly off to Hawaii to escape all his problems. After arriving in Hawaii and meeting the beautiful Rachel Jansen, Peter is shocked to see not only Aldous Snow in Hawaii, but also Sarah Marshall.','18',NULL,'https://image.tmdb.org/t/p/original/d4elOzyhNWVlxpG7BwigrumkFTe.jpg'),(800325,'The Dirt',2019,'The story of M?tley Cr??e and their rise from the Sunset Strip club scene of the early 1980s to superstardom.','18',NULL,'https://image.tmdb.org/t/p/original/xGY5rr8441ib0lT9mtHZn7e8Aay.jpg'),(800956,'Life in a Metro',2007,'Six different stories, about nine people, each with different issues and problems, all occurring within one place: the METRO.','PG',NULL,'https://image.tmdb.org/t/p/original/zkwM3HWD0SS4qUorxLcWcB1lWim.jpg'),(808306,'Honeymoon Travels Pvt. Ltd.',2007,'Six newly-married, diverse, honeymooning couples face marital bliss and discord, finding out more about themselves, their significant others and life in this happy-go-lucky, quirky drama.','PG 13',NULL,'https://image.tmdb.org/t/p/original/asRCPUjWW6S