er wanted to do and an unrealized need to come to terms with who they are. Together they embark on the road trip of a lifetime, becoming friends along the way and learning to live life to the fullest, with insight and humor.','PG 13',NULL,'https://image.tmdb.org/t/p/original/idbNSe8zsYKQL97dJApfOrDSdya.jpg'),(830515,'Quantum of Solace',2008,'Quantum of Solace continues the adventures of James Bond after Casino Royale. Betrayed by Vesper, the woman he loved, 007 fights the urge to make his latest mission personal. Pursuing his determination to uncover the truth, Bond and M interrogate Mr. White, who reveals that the organization that blackmailed Vesper is far more complex and dangerous than anyone had imagined.','PG 13',NULL,'https://image.tmdb.org/t/p/original/e3DXXLJHGqMx9yYpXsql1XNljmM.jpg'),(830558,'The Girl Next Door',2007,'In a quiet suburban town in the summer of 1958, two recently orphaned sisters are placed in the care of their mentally unstable Aunt Ruth. But Ruth\'s depraved sense of discipline will soon lead to unspeakable acts of abuse and torture that involve her young sons, the neighborhood children, and one 12-year-old boy whose life will be changed forever.','18',NULL,'https://image.tmdb.org/t/p/original/dXjLp7k7ILyg22T0s9VvpPKc9jn.jpg'),(837156,'Pee-wee\'s Big Holiday',2016,'A fateful meeting with a mysterious stranger inspires Pee-wee Herman to take his first-ever holiday.','PG',NULL,'https://image.tmdb.org/t/p/original/k5bZS2NsgVswuThBfyJYaV6T6zu.jpg'),(844471,'Cloudy with a Chance of Meatballs',2009,'Inventor Flint Lockwood creates a machine that makes clouds rain food, enabling the down-and-out citizens of Chewandswallow to feed themselves. But when the falling food reaches gargantuan proportions, Flint must scramble to avert disaster. Can he regain control of the machine and put an end to the wild weather before the town is destroyed?','PG',NULL,'https://image.tmdb.org/t/p/original/qhOhIKf7QEyQ5dMrRUqs5eTX1Oq.jpg'),(864835,'Mr. Peabody & Sherman',2014,'A young boy and his dog, who happens to have a genius-level IQ, spring into action when their time-machine is stolen and moments in history begin to be changed.','PG',NULL,'https://image.tmdb.org/t/p/original/c6kZC5pvwNIRSxiLL2JFGGc46He.jpg'),(869654,'Bonus Family',2017,'A new couple, their exes and their children navigate the emotional challenges and tricky logistics of blended family life in this Swedish dramedy.','PG',NULL,'https://image.tmdb.org/t/p/original/dzKF5BnmOlOl6BaNrnQbry5nb65.jpg'),(877057,'DEATH NOTE',2006,'Light Yagami is an ace student with great prospectsand hes bored out of his mind. But all that changes when he finds the Death Note, a notebook dropped by a rogue Shinigami death god. Any human whose name is written in the notebook dies, and Light has vowed to use the power of the Death Note to rid the world of evil. But will Light succeed in his noble goal, or will the Death Note turn him into the very thing he fights against?','PG 13',NULL,'https://image.tmdb.org/t/p/original/tCZFfYTIwrR7n94J6G14Y4hAFU6.jpg'),(878804,'The Blind Side',2009,'The story of Michael Oher, a homeless and traumatized boy who became an All American football player and first round NFL draft pick with the help of a caring woman and her family.','PG 13',NULL,'https://image.tmdb.org/t/p/original/bMgq7VBriuBFknXEe9E9pVBYGZq.jpg'),(886539,'Luck by Chance',2009,'Not wanting the same fate as befell her sisters, Sona Mishra re-locates to Mumbai to try to make a living making movies, but she soon finds that the path she has chosen is not an easy one.','PG',NULL,'https://image.tmdb.org/t/p/original/cIcKapfNtS1TmVoEASuE9OK9gPB.jpg'),(892769,'How to Train Your Dragon',2010,'As the son of a Viking leader on the cusp of manhood, shy Hiccup Horrendous Haddock III faces a rite of passage: he must kill a dragon to prove his warrior mettle. But after downing a feared dragon, he realizes that he no longer wants to destroy it, and instead befriends the beast  which he names Toothless