 of a tawdry and thoroughly unsuccessful crime novel, is approached by a woman named Manorama to investigate her husband, whom she suspects of having an affair.','18',NULL,'https://image.tmdb.org/t/p/original/1b5ZrBI48xbAVmCbNNhvFXz474y.jpg'),(923688,'Ezra',2007,'Ezra, jeune ex-soldat Sierra-L?onais, essaie tant bien que mal de retrouver des rep?res pour revenir ? une vie normale apr?s la guerre civile qui a ravag? son pays. Son quotidien est partag? entre un centre de r?habilitation psychologique et un tribunal de r?conciliation nationale organis? sous l\'?gide de l\'ONU. Durant le proc?s en r?habilitation auquel Ezra participe, il doit affronter sa soeur qui l\'accuse du meurtre de leurs parents. Ezra, qui a travers? cette violente guerre civile compl?tement drogu? et alcoolis?, ne se souvient de rien. Ezra reconna?tra-t-il l\'horreur et par ce fait, permettra-t-il ? sa soeur et ? sa communaut? villageoise d\'acc?der au pardon ?','PG',NULL,'https://image.tmdb.org/t/p/original/usQtVpG0euZPUbBCU044CNEs7G9.jpg'),(934949,'Twins Mission',2007,'When a precious Tibetan bead is stolen by rogue members of the mysterious Gemini Clan, the protectors of the bead enlist the help of some righteous former Gemini Clan members to retrieve the bead and bring the evil disciples to justice.','PG',NULL,'https://image.tmdb.org/t/p/original/lsLrwsa7TNLRaJlOpuewexVN5fE.jpg'),(948103,'Gurren Lagann',2007,'In the distant future, mankind has lived quietly and restlessly underground for hundreds of years, subject to earthquakes and cave-ins. Living in one such village are 2 young men: one named Simon who is shy and na?ve, and the other named Kamina who believes in the existence of a ?surface world above their heads.','PG 13',NULL,'https://image.tmdb.org/t/p/original/jLSe0OgbpXsHl5gUMF2iU3H4Rrq.jpg'),(964516,'Fashion',2008,'A small-town girl finally realizes her dream of becoming a famous supermodel but soon finds out that there\'s a price for her glamorous new life.','PG 13',NULL,'https://image.tmdb.org/t/p/original/6PQyJUJ3Ny1AZegtL5OkUATCIcr.jpg'),(972534,'iCarly',2007,'Watch Carly, Sam, and Freddie, as they try to balance their everyday 8th grade lives with their newfound fame managing and starring in the most awesome show on the web.','PG',NULL,'https://image.tmdb.org/t/p/original/pXghNQkOEenOOilNXlVnt9RbGo.jpg'),(978764,'Sucker Punch',2011,'A young girl is institutionalized by her abusive stepfather. Retreating to an alternative reality as a coping strategy, she envisions a plan which will help her escape from the mental facility.','PG 13',NULL,'https://image.tmdb.org/t/p/original/8oBc33JEnYm3rqPIwGtQXQbP96j.jpg'),(979891,'Hattrick',2007,'Despite cricket fever running wild, there are two people in India who dislike its influence over their lives. The first is Dr. Satyajit Chavan, who will not permit anyone in his home nor the hospital to view nor hear anything related to it; and the second is Kashmira, who is recently married to Sarabjeet Singh, and hates cricket as her husband is obsessed with it and has even neglected to be attentive leave alone take her for a honeymoon. Then there is Hemandra Patel, located in England for over 10 years, works as an airport Janitor, but has told everyone he is a Customs Officer, is awaiting word on his becoming a Citizen, but his fate rests with Immigration Officer, Cook, who hates all Patels, including Sardar Vallabhai Patel. Watch how the world cup influences them, and the shock that awaits Hemandra when he finds that his daughter is secretly seeing an English-African male by the name of Silver.','PG',NULL,'https://image.tmdb.org/t/p/original/yVH8QDymLIfZkSw4T6TUD9uVQC3.jpg'),(983983,'Shaun the Sheep',2007,'Shaun the Sheep thinks and acts like a person in a barnyard, which usually gets him into trouble. The farmer\'s sheepdog, Bitzer, tries to keep Shaun and his friends out of trouble. The farmer is oblivious to the humanlike features of his flock, who are like one big, happy family.','PG',NULL,'https://image.tmdb.org/t/p/original/z2gPfTQd3I0JLWOAEdKYMQRLoun.jpg'),(985991,'Horrid Henry',2006,'Horrid Henry is a British animated television series based on the book series by Francesca Simon produced by One Explosion Studios and Nelvana Limited, broadcast from late 2006 on Children\'s ITV in the UK and it will air on Cartoon Network Pakistan and Cartoon Network India on 2013 from 6am until 6:30am. The animation style differs from the Tony Ross illustrations in the books. Series Producer of the series is Lucinda Whiteley, Animation Director is Dave Unwin. The series has been sold to more than a dozen countries including France, Germany, South Africa, South Korea, and the Philippines.\n\nSo far, the two series have 104 episodes. The second series of 52 episodes started airing on 16 February 2009 and episodes from this series are currently being shown alongside episodes from the first series. There is a music album Horrid Henry\'s Most Horrid Album. The incidental music is composed by Lester Barnes and additional songs are composed by Lockdown Media.','PG',NULL,'https://image.tmdb.org/t/p/original/7ZBlUaLeJaE66BTttAlox3fTU4u.jpg'),(986264,'Like Stars on Earth',2007,'Ishaan Awasthi is an eight-year-old whose world is filled with wonders that no one else seems to appreciate. Colours, fish, dogs, and kites don\'t seem important to the adults, who are much more interested in things like homework, marks, and neatness. Ishaan cannot seem to get anything right in class; he is then sent to boarding school, where his life changes forever.','PG',NULL,'https://image.tmdb.org/t/p/original/fwXhw9bERqKrJfJK6WGakPIh3FS.jpg'),(986354,'Frank & Cindy',2007,'Frank & Cindy is a deeply personal documentary about Frank Garcia, an \'80s one-hit wonder musician, and his blonde bombshell wife Cindy, who makes him live in the basement.','PG',NULL,'https://image.tmdb.org/t/p/original/mvF839EGPWaHwC3jRkLivxvABif.jpg'),(988045,'Sherlock Holmes',2009,'Eccentric consulting detective Sherlock Holmes and Doctor John Watson battle to bring down a new nemesis and unravel a deadly plot that could destroy England.','PG 13',NULL,'https://image.tmdb.org/t/p/original/momkKuWburNTqKBF6ez7rvhYVhE.jpg'),(988982,'Naruto Shippuden the Movie',2007,'Demons that once almost destroyed the world, are revived by someone. To prevent the world from being destroyed, the demon has to be sealed and the only one who can do it is the shrine maiden Shion from the country of demons, who has two powers; one is sealing demons and the other is predicting the deaths of humans. This time Naruto\'s mission is to guard Shion, but she predicts Naruto\'s death. The only way to escape it, is to get away from Shion, which would leave her unguarded, then the demon, whose only goal is to kill Shion will do so, thus meaning the end of the world. Naruto decides to challenge this \"prediction of death.\"','PG 13',NULL,'https://image.tmdb.org/t/p/original/vDkct38sSFSWJIATlfJw0l3QOIR.jpg'),(990433,'A Love Story',2007,'Ian Montes is a picture of success. Despite being a son of a shipping tycoon, Ian refused to just ride in his father\'s empire. He built his own real estate company and earned his first million at a very young age. He never looked back since then. Driven by his ambition to become better, if not as good as his father, Ian managed to make it on his own. But behind all the glory is a man yearning for love and recognition.','PG',NULL,'https://image.tmdb.org/t/p/original/2yoXW56BGnFcXB0qrXa0fa6lZps.jpg'),(993840,'Army of the Dead',2021,'Following a zombie outbreak in Las Vegas, a group of mercenaries take the ultimate gamble: venturing into the quarantine zone to pull off the greatest heist ever attempted.','18',NULL,'https://image.tmdb.org/t/p/original/z8CExJekGrEThbpMXAmCFvvgoJR.jpg'),(994314,'Code Geass: Lelouch of the Rebellion',2006,'Japan has been invaded and conquered by the Britannian Empire. Japan is now known as Area 11 and its citizens known as Elevens. The Britannian Empire takes away Japan\'s autonomous power and imposes its rule through the use of Knightmares. The Empire\'s rule has never faltered, but cracks have begun to show...','PG 13',NULL,'https://image.tmdb.org/t/p/original/2cBDhzbP7KOLbWtTzxS4WIDLh70.jpg'),(1002563,'The Young Messiah',2016,'Tells the story of Jesus Christ at age seven as he and his family depart Egypt to return home to Nazareth. Told from his childhood perspective, it follows young Jesus as he grows into his religious identity.','PG 13',NULL,'https://image.tmdb.org/t/p/original/ubehK1ZnM0NQphchuaMeE4A1BZk.jpg'),(1017456,'Race',2008,'Ranvir and Rajiv are half brothers who own a huge stud farm in South Africa. Ranvir is a very shrewd and aggressive man while Rajiv is laid back, and a chronic alcoholic. Sophia, Ranvir\'s personal secretary adores and loves him. Ranvir is unaware of her feelings. Shaina, an Indian ramp model in Durban loves Ranvir but through a twist of fate gets married to his younger brother Rajiv. When she discovers that Rajiv is a chronic alcoholic, her world is shattered. Ranvir too is disturbed as he has sacrificed his love for his younger brother because Rajiv had promised to leave alcohol for good if he marries Shaina. In a weak moment Ranvir and Shaina come very close to each other. When Rajiv starts suspecting, all hell breaks loose. A murder is committed, a contract killing is issued. A sharp tongued detective R.D., getting wise on the proceedings, starts an intriguing investigation with his brainless bimbo assistant Mini','PG 13',NULL,'https://image.tmdb.org/t/p/original/krMI3hRmlgKcuNc3XBWtl8APasR.jpg'),(1018765,'Our Brand Is Crisis',2015,'Based on the documentary \"Our Brand Is Crisis\", this feature focuses on the use of American political campaign strategies in South America.','18',NULL,'https://image.tmdb.org/t/p/original/oKZtQpdIKi3TPV4UqVuvkbRkokv.jpg'),(1020042,'Old Thieves: The Legend of Artegio',2007,'Is the story of a generation of thieves who achieved their greatest victories in the sixties; their distinctive code of ethics, the various categories of delinquents inhabiting the city?s streets, their alliances with high ranking police officials that allowed them to operate, the betrayals that followed, and the price they ended up paying.','PG',NULL,'https://image.tmdb.org/t/p/original/AuxmgcevML7goL0i6fyD4IHo0p3.jpg'),(1024648,'Argo',2012,'As the Iranian revolution reaches a boiling point, a CIA \'exfiltration\' specialist concocts a risky plan to free six Americans who have found shelter at the home of the Canadian ambassador.','18',NULL,'https://image.tmdb.org/t/p/original/m5gPWFZFIp4UJFABgWyLkbXv8GX.jpg'),(1024942,'Just Another Love Story',2007,'Jonas is a Copenhagen homicide scene photographer, happily married, with two kids. One day, his car stalls, another car slams into him, runs head on into a third car and flips into the ditch. The other driver, Julia, is critically injured. He visits her in the hospital and is greeted by her family, who assumes he must be the Sebastian she told them about, the new fiance she met in Vietnam.','PG',NULL,'https://image.tmdb.org/t/p/original/oWY8hQ1vuEL9PLIzqoJtjGN3k2W.jpg'),(1024943,'Om Shanti Om',2007,'Om, a junior film artist, is smitten by Shantipriya, a renowned actress, but is killed while trying to save her from a fire accident. Thirty years later, he is reborn and sets out to avenge her death.','PG',NULL,'https://image.tmdb.org/t/p/original/oArsQTD4bPPMtRjqr03SO9W6phF.jpg'),(1033796,'Den-noh Coil',2007,'Denn? Coil, Coil  A Circle of Children, is a Japanese science fiction anime television series depicting a near future where semi-immersive augmented reality technology has just begun to enter the mainstream. The series takes place in the fictional city of Daikoku, a hotbed of AR development with an emerging city-wide virtual infrastructure. It follows a group of children as they use AR glasses to unravel the mysteries of the half real, half Internet city, using a variety of illegal software tools, techniques, and virtual pets to manipulate the digital landscape.\n\nDenn? Coil, in development for over a decade, is the series director debut of Japanese animator Mitsuo Iso. It premiered on NHK Educational TV on May 12, 2007. Due to the animators involved in its production and its unusually high-profile television broadcast time slot, Denn? Coil was highly anticipated.','PG 9',NULL,'https://image.tmdb.org/t/p/original/4bl5XmT52fdIlIQ5nkuP0LeFQLH.jpg'),(1034007,'Alias Grace',2017,'Based on the true story of Grace Marks, a housemaid and immigrant from Ireland who was imprisoned in 1843, perhaps wrongly, for the murder of her employer Thomas Kinnear. Grace claims to have no memory of the murder yet the facts are irrefutable. A decade after, Dr. Simon Jordan tries to help Grace recall her past.','16',NULL,'https://image.tmdb.org/t/p/original/m6ChYjCPMpzAPzR7jm0omLbu9hS.jpg'),(1037116,'One Piece: The Desert Princess and the Pirates: Adventure in Alabasta',2007,'A re-telling of the Alabaster Arc from One Piece (TV). Luffy and his crew come to rescue a land in the midst of a civil war, due to a powerful devil fruit user.','PG 13',NULL,'https://image.tmdb.org/t/p/original/qryaZLg7DkBkZtwKWTH6dfXjT3r.jpg'),(1037705,'The Book of Eli',2010,'A post-apocalyptic tale, in which a lone man fights his way across America in order to protect a sacred book that holds the secrets to saving humankind.','18',NULL,'https://image.tmdb.org/t/p/original/1H1y9ZiqNFaLgQiRDDZLA55PviW.jpg'),(1043451,'Delhi-6',2009,'Roshan, an NRI, arrives in Old Delhi with his ailing grandmother and starts to rediscover himself before getting caught in a religious dispute that shakes the once peaceful neighborhood.','PG',NULL,'https://image.tmdb.org/t/p/original/52raGhYfU3oM25imWZFZnQ16XZI.jpg'),(1045658,'Silver Linings Playbook',2012,'After spending eight months in a mental institution, a former teacher moves back in with his parents and tries to reconcile with his ex-wife.','18',NULL,'https://image.tmdb.org/t/p/original/y7iOVneBvITlBdhy6tVqXVOa1Js.jpg'),(1047832,'Linewatch',2008,'Academy Award Winner Cuba Gooding, Jr. is a Border Patrol Officer in the New Mexico desert with a secret past that is about to catch up with him. When his old gang leader tracks him down and forces him to smuggle drugs across the border, he must choose between the life he swore to leave behind and saving his family at any cost.','18',NULL,'https://image.tmdb.org/t/p/original/AnwkCEBHKZexU1Bj4KSfWvDc6wy.jpg'),(1059455,'The Legend of Bruce Lee',2008,'The story of the legendary martial arts icon Bruce Lee following him from Hong Kong to America and back again, leading up to his tragic death at the age of 32.','PG',NULL,'https://image.tmdb.org/t/p/original/t79JopFvZUhg2jaWB6ojIuMgKDz.jpg'),(1059786,'Eagle Eye',2008,'Jerry Shaw and Rachel Holloman are two strangers whose lives are suddenly thrown into turmoil by a mysterious woman they have never met. Threatening their lives and family, the unseen caller uses everyday technology to control their actions and push them into increasing danger. As events escalate, Jerry and Rachel become the country\'s most-wanted fugitives and must figure out what is happening to them.','PG 13',NULL,'https://image.tmdb.org/t/p/original/9KCOv0hL37IN3tWG3j86eZg3xDH.jpg'),(1063056,'From Within',2008,'When the citizens of a small evangelical town systematically begin committing suicide, a young girl struggling to reconcile her Christian upbringing with her desire to experience the outside world finds her faith put to the ultimate test.','18',NULL,'https://image.tmdb.org/t/p/original/yyAiGq6SycABwV9m9KqqB2i6Ctl.jpg'),(1064899,'Queen of the South',2016,'Teresa flees Mexico after her drug-runner boyfriend is murdered. Settling in Dallas, she looks to become the country\'s reigning drug smuggler and to avenge her lover\'s murder.','16',NULL,'https://image.tmdb.org/t/p/original/rzdC5EHkkKJE6OPVdh6gT1pR1c9.jpg'),(1070874,'The Trial of the Chicago 7',2020,'What was supposed to be a peaceful protest turned into a violent clash with the police. What followed was one of the most notorious trials in history.','18',NULL,'https://image.tmdb.org/t/p/original/ahf5cVdooMAlDRiJOZQNuLqa1Is.jpg');
